let subPass = document.getElementById("sub-pass")
let passField = document.getElementById("pass-in")
let replaceElem = document.getElementById("pass-prot")

var form = document.getElementById("pass-in-form");

function handleForm(event) {
    event.preventDefault();
}

form.addEventListener('submit', handleForm);

let ciphertext = ""

subPass.onclick = function () {
    replaceElem.innerHTML = CryptoJS.AES.decrypt(ciphertext, passField.value).toString(CryptoJS.enc.Utf8);
}